import React, { Component } from "react";
import { Link } from "react-router-dom";
import Base from "./Base";
import "./styles/projectList.css";
 
class Project extends Component {
  render() {
    return (
      <>
        <Base />
        <div className="wrapper-project">

          {/* for project in projects */}

            <div className="item-project">

              {/* if is_granted('ROLE_ADMIN') 
              <a className="deleteProjectButton-project alertDisplayerDelete_JS" 
                href="{{ path('app_delete_project',{id: project.id}) }}"
                data-page="{{ path('app_delete_project',{id: project.id, _csrf_token: csrf_token('delete')}) }}"

              >Supprimer ce projet</a>
              {% endif */}
              
              <span className="title-project">project.Name</span>

              <span className="tag-project">project.Technologies</span>

              <img className="image-project" src=""></img>
       
              <Link className="link-project" href="/Project/identifiant">DÃ©couvrir</Link>
              

            </div>
          {/* endfor */}

          {/* if is_granted('ROLE_ADMIN') %} 
            <a className="buttonAdd-project" href="{{ path('app_add_project') }}">Ajouter un nouveau projet</a>
          {% endif */}
          
        </div>
      </>
    );
  }
}
 
export default Project;
